INSERT INTO `information` VALUES
(2, '2011-11-01', 'родительское собрание', '2.11.2011 состоится родительское собрание в 15.30 в каб.53', 'student', 2, '2011-11-01 14:19:57'),
(3, '2011-11-01', 'Тест', 'Тест', 'student', 10, '2011-11-01 20:06:21'),
(4, '2011-11-02', 'Родительское собрание', 'Сегодня 2.11.2011 в 15.30 в каб. 53 состоится родительское собрание', 'student', 2, '2011-11-02 11:57:36'),
(5, '2011-11-02', 'Родительское собрание', 'Внимание!!! В связи с низкой явкой род. собрание переносится на 9.11.11. Явка обязательна', 'student', 2, '2011-11-02 14:06:49'),
(6, '2011-11-03', 'КВН', '3 ноября в 17.00 в ДК \\\"Дружба\\\" выступает команда КВН колледжа. Приглашем всех желающих.', 'student', 0, '2011-11-03 16:21:45'),
(7, '2011-11-08', 'Родительское собрание', 'Внимание!!! Завтра 9.11.11 состоится родительское собрание в 15.30 в каб. № 53! Явка-обязательна!', 'student', 2, '2011-11-08 14:32:03'),
(8, '2011-11-14', 'Внимание!!!', 'Уважаемые родители! Ваш баланс равен 0. Для пополнения счета обратитесь в колледж (каб. 46) или к классным руководителям.', 'balance', 0, '2011-11-14 16:37:48'),
(11, '2011-11-15', 'Попечительский взнос', 'Срочно оплатите попечительский взнос. Классный руководитель', 'student', 10, '2011-11-15 16:37:10'),
(12, '2011-11-15', 'КВН', '17 ноября в ДК \\\"Дружба\\\" в 18.00 состоится игра КВН в честь15-летия Покровского КВНа. Билеты можно приобрести в колледже в каб. 47', 'student', 0, '2011-11-15 16:52:17'),
(13, '2011-11-18', 'Внимание!!!', 'Уважаемы родители!Бесплатный тестовый период заканчивается. Если вы желаете и дальше пользоваться услугами электронного дневника, обратитесь в каб. 46 или к своему классному руководителю.Стоимость услуг 150 руб. в месяц.', 'student', 13, '2011-11-18 16:31:37'),
(14, '2011-11-30', '', '1.12.2011 в актовом зале проводится смотр-конкурс художественной самодеятельности 1,2,3 курсов под девизом:\\\"Будущее за нами\\\"', 'student', 0, '2011-11-30 18:36:00');
